    false,nt"url": null,nt"notes": "This Water Management Plan has been developed
    to meet the station objectives set forth in the Master Plan. The Annada District
    of Mark Twain NWR and the Delair Division, Gardner Division, and Gregory Landing
    Division of Clarence Cannon NWR are covered by this plan. The purpose of this plan
    is to establish a schedule of operations for the manipulation of managed waters.
    Recent emphasis has elevated the importance of management of moist soils to provide
    for the needs of waterfowl and other wildlife while de-emphasizing the cropland
    management program. Maintenance, rehabilitation and development of these lands has
    resulted in progress in this area. Attached are project worksheets and unit maps.",nt"license_title":
